% ------------------------------------
% MATLAB script to build SerDes System
% ------------------------------------

% Build cell array of Tx blocks:
txBlocks{1} = serdes.FFE;
txBlocks{1}.BlockName = 'FFE';
txBlocks{1}.Mode = 1;
txBlocks{1}.TapWeights = [0 1 0 0 0];
txBlocks{1}.Normalize = true;

% Build cell array of Rx blocks:
rxBlocks{1} = serdes.CTLE;
rxBlocks{1}.BlockName = 'CTLE';
rxBlocks{1}.Mode = 1;
rxBlocks{1}.ConfigSelect = 0;
rxBlocks{1}.Specification = 'DC Gain and Peaking Gain';
rxBlocks{1}.PeakingFrequency = 6250000000;
rxBlocks{1}.DCGain = -5;
rxBlocks{1}.PeakingGain = 5;
rxBlocks{1}.PerformanceCriteria = 'SNR';
rxBlocks{1}.FilterMethod = 'PartialFraction';

% Build txModel:
txAnalogModel = AnalogModel( ...
	'R',50, ...
	'C',1.000000e-13);
tx = Transmitter( ...
	'Blocks',txBlocks, ...
	'AnalogModel',txAnalogModel, ...
	'RiseTime',1.000000e-11, ...
	'VoltageSwingIdeal',1, ...
	'Name','TX');

% Build rxModel:
rxAnalogModel = AnalogModel( ...
	'R',50, ...
	'C',2.000000e-13);
rx = Receiver( ...
	'Blocks',rxBlocks, ...
	'AnalogModel',rxAnalogModel, ...
	'Name','RX');

% Build ChannelData:
channel = ChannelData( ...
    'Impulse',getimpulse(),...
	'dt',8.000000e-12);

% Build Jitter And Noise Object:
jitter = JitterAndNoise( ...
	'RxClockMode','clocked');

% Build SerDes System:
SymbolTime = 8e-11;
SamplesPerSymbol = 16;
ModulationLevels = 2;
BERtarget = 1e-12;
sys = SerdesSystem(...
	'TxModel',tx,...
	'RxModel',rx,...
	'ChannelData',channel,...
	'JitterAndNoise',jitter,...
	'SymbolTime',SymbolTime, ...
	'SamplesPerSymbol',SamplesPerSymbol, ...
	'Modulation',ModulationLevels, ...
	'Signaling','Differential', ...
	'BERtarget',BERtarget);

%Visualize Pulse Response
figure
plotPulse(sys)

%Visualize PRBS Waveform Response
figure
plotWavePattern(sys)

%Plot bathtubs, Statistical Eye and contours
figure
plotStatEye(sys)

%Display Report
analysisReport(sys)

% To export Serdes System to Simulink execute the following command:
% exportToSimulink(sys);


